import React, { Fragment } from "react";
import Header from "./components/Layouts/Header";
import Food from "./components/Food/Food";
import Cart from "./components/Cart/Cart";

const App = () => {
  return (
    <Fragment>
      <Cart />
      <Header />
      <main>
        <Food />
      </main>
    </Fragment>
  );
};

export default App;
